        <h3>üí° Suggested Subjects</h3>
        {suggestedSubjects?.length > 0 ? (
          <p>‚úîÔ∏è Received {suggestedSubjects.length} suggested subjects.</p>
        ) : (
          <p>‚ùå No suggested subjects received.</p>
        )}
      </div>
    );
  }


